import React from 'react';
import ReactDOM from 'react-dom';
import {
  Route, BrowserRouter, Switch, 
  Routes, Redirect } from 'react-router-dom';

import './index.css';

import App from './App';
import Login from '../src/Pages';
import NotFound from './Pages/NotFound/NotFound'
// import ListarEquip from './Pages/ListarEquipamentos';
// import Empresas from './Pages/Empresas';
import MapaEquipamento from './Pages/MapaDeEquip/index';
import reportWebVitals from './reportWebVitals';

const routing = (
  <BrowserRouter>
    <div>
      <Switch>
        <Route exact path="/" component={Login}/>
        <Route path="/MapaEquipamento" component={MapaEquipamento}/>
        {/* <Route path="/ListarEquipamento" component={ListarEquip}/>
        <Route path="/Empresas" component={Empresas}/> */}

        <Route path="/NotFound" component={NotFound}/>
        <Redirect to="/NotFound"/>
      </Switch>
     
      {/* <Routes>
      </Routes> */}
    </div>
  </BrowserRouter>
);      

ReactDOM.render(
  routing, 
  document.getElementById('root')
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
